import React from 'react';
import { Form, Input } from '@rocketseat/unform';
import { Link } from 'react-router-dom';
import * as Yup from 'yup';
import { Logo, Container1, Container2, Wrapper, FooterForm } from './styles';

import logo from '../../assets/400dpiLogoCropped.png';

const schema = Yup.object().shape({
  email: Yup.string()
    .email('!')
    .required('!'),
  password: Yup.string().required('Insira uma senha'),
});

export default function SignIn() {
  function handleSubmit(data) {
    console.log(data);
  }

  return (
    <Wrapper>
      <Container2>
        <div id="container">
          <div id="h1">
            <h1>AINDA NÃO ABRIU SUA CONTA?</h1>
          </div>
          <div id="p">
            <p>
              Depósitos, transferências e retiradas com segurança e eficiência
            </p>

            <button type="submit">ABRIR MINHA CONTA</button>
          </div>
        </div>
      </Container2>
      <Container1>
        <Logo src={logo} alt="logo" />
        <div>
          <Form schema={schema} onSubmit={handleSubmit}>
            <div id="input">
              <Input name="email" type="email" placeholder="Email" />
            </div>
            <div id="input">
              <Input name="password" type="password" placeholder="Senha" />
            </div>
            <FooterForm>
              <p>
                Esqueceu sua senha? <Link to="/">clique aqui</Link>
              </p>
              <button type="submit">LOGIN</button>
            </FooterForm>
          </Form>
        </div>
      </Container1>
    </Wrapper>
  );
}
